import React, { Component } from 'react';

class Monsters extends Component {

  constructor(props) {
    super(props);
    this.state = { 
      monsters: [],
      isLoaded: false,
    }
  }

  componentDidMount() {

    fetch('https://botw-compendium.herokuapp.com/api/v2/category/monsters')
    .then(res => res.json)
    .then(json => {
        this.setState({
          isLoaded: true,
          monsters: json,
        })
    })
  }

  render() {
    var {isLoaded, monsters} = this.state; 

    return (  
      <div></div>
    );
  }
}

export default Monsters;
